import React from 'react';
import { Form, Input, Select } from 'antd';
import { setEn,setZh } from '../state/reducer';
import { useDispatch, useSelector } from 'react-redux';

const { Option } = Select;

export default function ModalBox ({ item }) {
  console.log(item);
  const language = useSelector(state=>state.language.lang);
  const dispatch = useDispatch();
  return (
    <div>
      <Form.Item label="Address">
        <Input.Group compact>
          <Form.Item
            name={ [ 'address', 'province' ] }
            noStyle
            rules={ [ { required: true, message: 'Province is required' } ] }
          >
            <Select >
              <Option value="中文" onChange={ ()=>{dispatch(setZh()); console.log(language);} }>中文</Option>
              <Option value="英文" onChange={ ()=>{dispatch(setEn()); console.log(language);} }>英文</Option>
            </Select>
          </Form.Item>
          <Form.Item
            name={ [ 'address', 'street' ] }
            noStyle
            rules={ [ { required: true, message: 'Street is required' } ] }
          >
            <Input style={{ width : '50%' }} placeholder="Input street" value={ item.name }/>
          </Form.Item>
        </Input.Group>
      </Form.Item>
    </div>
  );
}
